شاهزاده‌ها در اصفهان کجا حمام می‌رفتند؟

حمام‌ شاهزاده‌ها در اصفهان که قدمتش به دوره صفویه می‌رسد با وجود اینکه از سال ۵۴ در فهرست آثار ملی ثبت شده بود اما در این سال‌ها به دلیل بی‌توجهی به مخروبه‌ای ترسناک تبدیل شده بود. شهرداری اصفهان اما با صرف ۵۰ میلیارد تومان بودجه این حمام زیبا و خاص را به صورت کامل مرمت کرده است.

